import React from 'react';

const Grea = (num) => {
 if(num >=0 && num <12){
    return "Good morning";
 }
 else if(num >=12 && num <17){
    return "Good Afternoon";
 }
 else{
    return "Good Evening";
 }
}

export default Grea;
